import React, { useState, useEffect } from 'react';
import Typed from 'typed.js';
import { motion } from 'framer-motion';
import './HeroSection.css';
const citiesInPakistan = [
  "Islamabad", "Lahore", "Karachi", "Murree", "Peshawar",
  "Skardu", "Hunza", "Quetta", "Multan", "Faisalabad",
];

const HeroSection = () => {
  const [startingPoint, setStartingPoint] = useState('');
  const [destination, setDestination] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [guests, setGuests] = useState(1);

  useEffect(() => {
    const options = {
      strings: ['Discover Pakistan\'s Hidden Gems', 'Explore Beautiful Landscapes', 'Experience Rich Culture'],
      typeSpeed: 50,
      backSpeed: 50,
      loop: true,
    };
    
    const typed = new Typed('.typed-text', options);

    return () => {
      typed.destroy();
    };
  }, []);

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Search:', { startingPoint, destination, startDate, endDate, guests });
  };

  return (
    <div className="hero-section">
      <motion.div 
        className="hero-content"
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
      >
        <h1 className="main-title">Voyaige</h1>
        <h2 className="subtitle">Your Personal AI Trip Planner</h2>
        <h3 className="tagline typed-text"></h3>
      </motion.div>
      <motion.form 
        onSubmit={handleSearch} 
        className="search-form"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5, delay: 0.2 }}
      >
        <div className="search-row">
          <div className="search-input">
            <i className="fas fa-map-marker-alt"></i>
            <select
              value={startingPoint}
              onChange={(e) => setStartingPoint(e.target.value)}
              placeholder="Starting Point"
            >
              <option value="" disabled>Select Starting Point</option>
              {citiesInPakistan.map((city, index) => (
                <option key={index} value={city}>{city}</option>
              ))}
            </select>
          </div>
          <div className="search-input">
            <i className="fas fa-map-marker-alt"></i>
            <select
              value={destination}
              onChange={(e) => setDestination(e.target.value)}
              placeholder="Where are you going?"
            >
              <option value="" disabled>Select Destination</option>
              {citiesInPakistan.map((city, index) => (
                <option key={index} value={city}>{city}</option>
              ))}
            </select>
          </div>
          <div className="search-input">
            <i className="far fa-calendar-alt"></i>
            <input
              type="date"
              placeholder="Start Date"
              value={startDate}
              onChange={(e) => setStartDate(e.target.value)}
            />
          </div>
          <div className="search-input">
            <i className="far fa-calendar-alt"></i>
            <input
              type="date"
              placeholder="End Date"
              value={endDate}
              onChange={(e) => setEndDate(e.target.value)}
            />
          </div>
          <div className="search-input">
            <i className="fas fa-user-friends"></i>
            <select
              value={guests}
              onChange={(e) => setGuests(Number(e.target.value))}
            >
              <option value="1">1 Guest</option>
              <option value="2">2 Guests</option>
              <option value="3">3 Guests</option>
              <option value="4">4+ Guests</option>
            </select>
          </div>
        </div>
        <motion.button 
          type="submit" 
          className="search-button"
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
        >
          <span>Explore Now</span>
          <i className="fas fa-paper-plane"></i>
        </motion.button>
      </motion.form>
    </div>
  );
};

export default HeroSection;
